import Vue from 'vue';  

import Router from 'vue-router';

import App from './pages/App.vue'
import Event from './pages/Event.vue'

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {   

      path: '/event',             
      name: Event,      
    },
    {   

      path: '/',             
      name: App,      
    }
    , 
  ]
});
new Vue({
  el: '#app',
  render: h => h(App),
  router: router,
});
